import React from 'react';
import './SmartContent.css';

interface User {
    mobileNumber: string;
    name: string;
    dataBalance: number;
}

const mockData: User[] = [
    { name: 'John Doe', mobileNumber: '09171234567', dataBalance: 1024 },
    { mobileNumber: '09179876543',  dataBalance: 512 },
    { mobileNumber: '09171239876', name: 'Alice Johnson', dataBalance: 256 },
];

const SmartContent: React.FC = () => {
    return (
        <div>
            <h3>SMART Data Balance</h3>
            <table>
                <thead>
                    <tr>
                        <th>Mobile Number</th>
                        <th>Name</th>
                        <th>Remaining Data (MB)</th>
                    </tr>
                </thead>
                <tbody>
                    {mockData.map((user, index) => (
                        <tr key={index}>
                            <td>{user.mobileNumber}</td>
                            <td>{user.name}</td>
                            <td>{user.dataBalance}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default SmartContent;
